INSERT INTO `search_dataset` VALUES (5,'node',' welcome to the british association of seoul the british association of seoul bass was established as a social group for the british expat community today we offer a range of social and cultural activities and events in and around seoul the majority of which are open to the entire international community as a member of the british association of seoul you can make new friends and enjoy the challenges of living in a new country our committee members are ready to answer your questions and help you access other useful organisations and resources our monthly enewsletter and events keep members in touch with what s happening in the british community and around seoul bass also aims to provide financial support to korean charities our major fundraising event is the queen s birthday ball  last year the queen s birthday ball was held on 30th may at the grand hyatt hotel the ballroom was decorated with images from the great british seaside a pier beach huts and seagulls to name but a few it was a lighthearted and nostalgic look at a great british tradition thanks to many very generous sponsors and almost 500 guests over 100 million won was raised take a look at our web pages on korean charities and the ball and at our photo gallery  to learn more about this fabulous night out and the deserving causes it benefits the british association of seoul is a voluntary organisation run by an elected committee membership is open to anyone with a uk passport the spouse of a passport holder or anyone with an interest in or close ties to the british community all members are eligible to work on the committee and vacancies arise continually so please let us know if you are interested in helping we hope to see you at a bass event soon ruth attewell president  ',1267449506);
