INSERT INTO `search_dataset` VALUES (69,'node',' learn to cook traditional indian cuisine monday 8 march 2010 1030 1200 chakraa restaurant itaewon krw 40000 session or krw 150000 for all 4 sessions not bass event we are pleased to promote on behalf of the chakraa spice club a bass exclusive learn how to cook traditional indian cuisine using ingredients which are all available in seoul chakraa spice club offers classes in indian cooking for those who want to learn how to cook or expand their skills the sessions will run over two weeks on a monday and wednesday classes 1030am to 1200pm lunch from 1215pm cost krw 40000 per session or krw 150000 for all 4 sessions costs include the lesson fee recipes and lunch the deadline for sign up and payment is strictly monday 22nd february and there is a minimum of 15 places for the classes to run please note this is not a bass event if you would like to register or obtain further information please call 01050500758 or email spiceclub chakraacokr or chakraaspiceclub gmailcom  all sign ups we have previously received have been passed to the organiser  ',0);
