INSERT INTO `search_dataset` VALUES (84,'node',' membership the british association of seoul welcomes all members of the british community full membership is available to anyone with a uk passport or the spouse of a passport holder full membership includes both member and spouse and costs krw 50000 per year january 1st to december 31st associate membership is available to anyone with close ties to or an interest in the british community ie children at the british school member of a commonwealth country lived in the uk etc the fee for associate membership is also krw 50000 bass members receive a monthly newsletter sent via email updating you on upcoming bass activities and announcements other organisations also advertise their events in our newsletter please check the events calendar for upcoming bass events non members are welcome at bass events but pay more to attend so please join today if you would like to join the british association of seoul please contact  basseoul yahoocouk  or download an application form below microsoft word compatible program required you can download a free viewer from microsoft here  print it complete it and return it along with your application fee to our membership coordinator regina dixon or any bass committee member at the next coffee morning or you can pay your membership fees through a bank transfer  click here for bank transfer details we look forward to seeing you soon attachment size membershipformdoc 345 kb  ',0);
INSERT INTO `search_dataset` VALUES (85,'node',' annual events april 2010 gloster valley commemoration bass members are invited to join veterans and their families to commemorate the actions of british and commonwealth forces during the korean waryou must register to attend rsvp at basseoul yahoocouk may 2010 the queen s birthday ball the queen s birthday ball is the most glamorous nightout in the british association s calendar and it is also our biggest fundraising event of the year come and dance the night away for a causeyou must register to attend rsvp at basseoul yahoocouk september 2010 the enchanted evening the enchanted evening is held in the beautiful grounds of the british embassy to welcome back those returning after the summer and all those new to seoul you must register to attend open to members only rsvp at basseoul yahoocouk november 2010 christmas fair come and join our annual christmas fair featuring imported british foods home baked goods and much more enjoy some relaxed christmas shopping over a glass of mulled wine open to everybody  december 2010 bass christmas lunch don t miss one of the merriest events in our association s calendar we hold our christmas lunch early december each year a fabulous glamorous event including entertainment fun and games sumptuous lunch and a chance to win some exciting prizes you must register to attend rsvp at basseoul yahoocouk december 2010 mince pie morning members are treated to a carol service by children from the british school at the embassy residence enjoy mince pies and other festive treats on offer you must register to attend open to members only rsvp at basseoul yahoocouk ',1267752760);
INSERT INTO `search_dataset` VALUES (86,'node',' how to get involved throughout the year bass organises many varied events for the enjoyment of members their spouses and families nonmembers are welcome at bass events but must pay more to enjoy the fun so email us today at basseoul yahoocouk  if you d like to become a member check our event calendar to see what s happening over the coming months if you would like to attend an event please email basseoul yahoocouk monthly meeting join us on the 4th tuesday of every month at the the seoul club come along and meet other members including newcomers in a friendly and supportive atmosphere to get to the seoul club take subway line 3 to dongguk university station exit 6 and then it s a 5 minute bus ride on the no 2 yellow bus outside the station just one stop up the hill or it s a short taxi ride the seoul club is located halfway between the shilla hotel and tower hotel ph 0222387666 coffee morning informal gettogethers hosted by bass members in their own homes a chance to catch up with old friends make new ones and enjoy a fine selection of cakes and biscuits a toy box is available at the homes for members with toddlers or young children check the event calendar for the date of the next one or contact us at basseoul yahoocouk  if you d like to host gloster valley commemoration each april bass members are invited to join veterans and their families to commemorate the actions of british and commonwealth forces during the korean war queen s birthday ball celebrate the birthday of her majesty oueen elizabeth ii in the sumptuous surroundings of the grand hyatt hotel in seoul and support our biggest fundraising event of the year  the enchanted evening the enchanted evening is held in the beautiful grounds of the british embassy to welcome back those returning after the summer and all those new to seoul christmas fair come and join us for our annual christmas fair featuring lots of stalls with great food and other items for your christmas shopping christmas lunch don t miss one of the merriest events in our association s calendar we hold our christmas lunch early december each year come join us for some christmas cheer  mince pie morning bass members are treated to a carol service by children from the british school at the embassy residence enjoy the mince pies and other festive treats on offer quiz nights round up your friends and pit your wits against some of the finest minds in seoul there are prizes and pride to be fought for  day trips throughout the year we organized excursion to interesting places in and around seoul it s a wonderful way to settle in and discover new venues mahjongg come and see what this fun and highly addictive game is all about everyone is welcome even those who have never played before  ',0);
INSERT INTO `search_dataset` VALUES (87,'node',' the queen s birthday ball every year the queen s birthday ball is the most glamorous nightout in the british association s calendar it is also our major fundraiser we are proud to have the generous support of many sponsors from the seoul business community some sponsors provide the goods and services we need to run this fantastic event others support our nominated charities directly by donating of cash every year the theme of the ball is kept a secret until the doors are opened to admit the 500 guests to the amazing ballroom the theme is always connected with our british heritage and on 30 may 2009 the grand ballroom of the grand hyatt hotel was transformed into the great british seaside the ballroom was decorated with colourful beach huts union jack bunting and giant icecream cones and guests were entertained with barbershop singing by the the lightyears the roast beef dinner was followed by a live auction of manchester united items korean art and a signed golf jacket big prizes in the grand raffle were drawn and then guests poured onto the dancefloor for two storming sets from the lightyears who performed on a mockup of the entrance to brighton pier there are some great photos of the evening on this website if you would like to sponsor this event in 2010 please contact us there are many ways we can work together to give muchneeded assistance to the underprivileged whilst also providing the international community with one of its best nights out  ',0);
INSERT INTO `search_dataset` VALUES (88,'node',' useful organisations and services in seoul british embassy the british embassy is located next to deoksu palace and just a short walk from the seoul city hall seoul plaza hotel area seoul global center seoul global centre opened in january 2008 is a support organization initiated by the seoul city government for foreign residents in seoul seoul global centre provide practical solutions to a wide variety of problems that foreigners may encounter in their daily life in business or as tourists among the comprehensive range of services provided are the medical referral services immigration related services korean language class business services administration issuance of certificate tax affairs driving licence tourism cultural programs etc seoul international women s association siwa  siwa is the largest international women s organisation in korea siwa s purpose is to further opportunities for sharing social cultural welfare and community interests among women of different nationalities seoul foreign school located in yeonhi dong district of seoul the british school is part of seoul foreign school and follows the national curriculum of england and wales st andrew s society of seoul a social group for scots or those of recent scottish descent the society holds three main events every year to which all nationalities are welcome st andrew s ball november black tie dinner and scottish dancing burns supper january black tie dinner celebrating the birth of scottish poet robert burns and the mukleshunter may informal buffet and scottish dancing scottish dancing lessons are available several weeks before the balls for more information please contact gavin mackay at gsausage kornetnet british chamber of commerce in korea the objectives of the chamber are to promote the development of the british trade commerce and investment in the republic of korea to represent the opinion of the british business community in korea on trade commerce finance and industry and to provide opportunities for british and korean chamber members to meet for business and social purposes the royal asiatic society ras  joining the ras is an excellent way to learn more about korean culture and history twice monthly lectures are held on tuesday evenings at 730pm at somerset palace building 2nd and 4th tuesdays of each month and there are regular weekend tours to places of interest all over korea the ras also has an impressive stock of books for sale useful local services  fire medical emergencies dial 119 police dial 112 medical referral service english speaking medically trained professionals answer all calls and will refer callers to an appropriate medical facility 800 am8 pm business hours 800 pm8 am emergencies only tel 01047698212 or 01087508212 email  medicalreferral seoulgokr nemc national emergency medical center for assistance telephone its 24 hour english speaking service on 021339 knto korean national tourist office  official site for korea tourism organisation for information in english telephone 021330 visit seoul the official seoul city tourism website find everything you need to know about seoul seoul metropolitan government find city maps subway and bus information wwwkorea4expatscom a comprehensive online source of information about life events and everything else concerning expats in seoul expat advisory service an extremely useful website for expats to post questions on a bulletin board and then receive answers from other members of the community international taxi for foreigners for info and reservations call taxi center at 16442255 english and japanese available around the clock and online animal quarantine inspection service find quarantine regulations in this helpful guide veterinary surgeon dr kwon dr kwon is a really great young man with a good heartall that one wants in a vet  contact details  landline 027984993 mobile 0117284408 address 211 itaewondong yongsanku seoul directions with the hamilton hotel behind you go straight down the road bordered by gecko s and burger king and the road will curve round to the left shortly thereafter on left side is the vet s clinic it has a dark blue exterior and is opposite the chung wah mansions a large set of apartment blocks  ',0);
INSERT INTO `search_dataset` VALUES (89,'node',' supporting korean charities since our founding in 1977 bass has sought not only to support the british expatriate community but also to provide financial assistance for korean charities thanks to the generosity of our members the business community and our korean hosts the british association of seoul is able to donate to korean charities each year funds are raised throughout the year via our various activities but our main fundraising event is the queen s birthday ball in 2009 bass raised and donated over 127 million krw like to help us  give your time to people in need the reward will be tremendous whether it is two hours per year or two hours per day you can make a difference in people s lives at present we have 6 people on the welfare committee if you would like to visit any of these projects or would like to get involved we would love to hear from you we make short trips and longer trips visiting our projects locations members with younger children may go on the shorter trips and members with no or older children go on the longer trips no pressure just lots of fun we always need help contact us at  basseoul yahoocouk bass projects 2009 myongdo st columban s home in mokpo 2009 main project seoul s women s shelter setting up a workshop for the women who work for their living st patrick s centre geumsan setting up a library social centre in their new premises jeon jin sang clinic hospice seoul purchase of an imaging machine for their xray system anna s house for the homeless chungwon assistance with food anna s nursing home purchase of an industrial washing machine chun cheon home for the elderly chun cheon purchase of an industrial oven for nora s bakery john s village gwangju arcaffe project for vocational training of psychiatric patients woorinuri study room seoul for the english education of 27 children from under privileged families pigum island volunteers shinangun purchase of a fridge for storage of food distributed to the homebound elderly new light community seoul assistance with medication and food to hiv patients mohyun medical center pocheon renovation of hospice sungshim didimdol youth shelter seoul purchase of computers dehumidifiers and projectors motungi shelter seoul renovation of bathroom salvation army annual donation gloster valley scholarship fund annual donation past projects jungwon home for the elderly paju sungrowon children s home st colomban s home and hospice for the elderly chuncheon the open door centre yangpyeong donghaewon hansen disease village shin an goat project  ',0);
INSERT INTO `search_dataset` VALUES (90,'node',' monthly newsletter we produce monthly newsletters for our members and also events updates throughout the month to notify our members of other bass events and happenings within the seoul community click below to read the current or past editions adobe acrobat reader is required  click here to download it from adobe  attachment size february 2010 279 mb december 2009 101534 kb november 2009 91867 kb september 2009 270 kb  ',0);
INSERT INTO `search_dataset` VALUES (91,'node',' ruth attewell president i was born in leeds and before moving to korea my biggest moves were to newcastle upon tyne where i took a degree in business and to staines just outside london where i did my professional accountancy qualification i also met my husband glen there as we were both working for british gas several jobs five house moves and three teenage sons later we came to seoul in march 2006 we have enjoyed our time here very much and made lots of great friends i have taken classes in korean language hanji and korean cooking and studied a course in teaching english conversation i enjoy exercising anything from spinning classes to skiing and walking our gorgeous english cocker spaniel sunny i also had a brief affair with touch rugby as part of the now legendary han bags team my latest interest is pilates so don t forget to tell me how toned i m looking next time you see me 18  ',0);
