INSERT INTO `search_dataset` VALUES (93,'node',' fiona jane uden honorary chair born in jersey channel islands 1960 educated in drury falls school hornchurch essex started ballet at an early age and was accepted at the martha graham school of contemporary dance in london continued to dance with many different dance companies overseas including korea until she met and married martin uden then second secretary in the british embassy in 1980 posted with husband to bonn germany 1986 back to korea 19941997 ottawa canada 19972001 and san francisco 20032007 returned to seoul for a third time in february 2008 during overseas posting has worked with flowers and local interests has two sons thomas and matthew interests include travel ballet music swimming and reading 0  ',1267196029);
INSERT INTO `search_dataset` VALUES (94,'node',' suzan walsh ',0);
INSERT INTO `search_dataset` VALUES (95,'node',' suzan walsh vice president and welfare chairperson i have worked long years in the hospitality business where work is 24 hours a day even then i still made time to work for social and welfare groups i was on the advisory committee of a foundation to help orphaned children and a member of a rotary club in turkey it was and still is rotary in the uk followed by dubai international women s club in dubai and presently bass in seoul i love working for a cause and i find bass a wonderful and fun group to be with i am in seoul with my husband mike our children are both grown up our son is living in dubai and our daughter in leeds puzzles and crosswords books and lately oil paiting are my interests i am at the moment preparing for my third joint exhibition with the hope of having a solo exhibition one day in my retirement days 0  ',1267196051);
INSERT INTO `search_dataset` VALUES (96,'node',' karen holden ',0);
INSERT INTO `search_dataset` VALUES (97,'node',' karen holden treasurer i arrived in seoul summer 2008 having left the uk in august 2002 for dubai then being moved to taiwan 4 years later i have two children emma who is at sfs high school and ben who is at sfs british school we also have a siamese cat called smokey and a cat adopted here in korea called tongdong my husband john has worked for hsbc all his working life which is where we first met i have had many jobs within hsbc including finance manager at a uk regional head office in dubai i worked as a nursery school teacher teaching 4 year olds and in taiwan i worked at an international school teaching children with special needs 11 my favourite hobby is playing world of warcraft a great computer game i m addicted 0  ',1267196073);
