INSERT INTO `search_dataset` VALUES (99,'node',' regina dixon membership coordinator i was born in the uk of polish parents i am married to gavin and we have 3 daughters at sfbs and an adopted failed guide dog called lemon we left the uk in january 2006 on our first expat move to singapore we really enjoyed our 2 and half years there we arrived in seoul in july 2008 and i immediately joined bass i became a committee member 6 months later in january 2009 initially helping out the events team but now have taken over membership 0  ',1267196089);
