INSERT INTO `search_dataset` VALUES (39,'help',' ical parser standardized ical parser and creator the ical parser is found in dateapiicalinc which is not included by default include that file if you want to use these functions this feature can be used to parse vevents vlocations valarms and all kinds of timezone options and repeat rules for ical imports the ical parser is used by feed api to import ical feeds  dateicalexport dateicalimport dateicaldateformat  ',0);
INSERT INTO `search_dataset` VALUES (40,'help',' views date handling custom modules and add their own dates to the list the date api views filter and date api views argument can handle see the following example for the way that core dates have been added implementation of hookdateapifields on behalf of core fields all modules that create custom fields that use the viewshandlerfielddate handler can provide additional information here about the type of date they create so the date can be used by the date api views date argument and date filter function dateapidateapifields field values array the type of date dateunix dateiso datedatetime sqltype dateunix timezone handling options none site date utc tzhandling site needed only for dates that use date tzhandling timezonefield needed only for dates that use date tzhandling offsetfield array of tablefield values for related fields that should be loaded automatically in the views sql relatedfields array granularity of this date field s db data granularity array year month day hour minute second switch field case userscreated case usersaccess case userslogin case nodecreated case nodechanged case noderevisionstimestamp case filestimestamp case nodecountertimestamp case accesslogtimestamp case commentstimestamp case nodecommentstatisticslastcommenttimestamp return values  ',0);
INSERT INTO `search_dataset` VALUES (41,'help',' readme date repeat node generator this module is intended as an addon for the wonderful date repeat module part of the date package of modules it grew out of the feature request discussion at http drupalorg node 298334 date repeat allows you to specify a wide range of repeating date sequences however these sequences are all stored within a single node and merely presented as separate dates on calendars if you have a series of events which occur periodically but each event is different from the other eg a weekly game where the opposing teams are different each week date repeat doesn t quite do what you need this module fixes that problem by allowing you to generate one node for each event in your sequence upon creation of the first node as part of the node editing form you ll see a question prompting you to generate each date as a single node answering no will stick with the default date repeat behavior answering yes will ceate one node for each date in the repeating pattern you ve specified as determined by the date repeat api this behavior only occurs when you create a new node because sequence editing has not yet been tackled nothing at all happens when you update an existing node this module is not yet ready for a production site it only allows you to create a new sequence of nodes other popular date sequence features like changing the pattern for all events in the sequence or all future events in the sequence upon edit are not yet supported there have been bugs reported which could not reproduced but might surface again and in other ways the module is a bit rough around the edges so don t use it on a production site but by all means test and submit patches and feedback  ',0);
INSERT INTO `search_dataset` VALUES (42,'help',' readme image module imagemodule is responsible for the creation maintenance of image nodes that can be used for several purposes such as embedding in other nodes or used on their own to display photographs screenshots or diagrams author james walker  ',0);
INSERT INTO `search_dataset` VALUES (43,'help',' readme  id readmetxt v 11128 20090925 133057 ufku exp imce is an image file uploader and browser that supports personal directories and quota imce can easily be integrated into any wysiwyg editor or any web application that needs a file browser see integration methods for more information features basic file operations upload delete image jpg png gif operations resize create thumbnails preview support for private downloads configurable limits for user roles file size per upload total directory size quota file extensions and image dimensions personal or shared folders for users userfriendly interface directory and file listing file sorting by name size dimensions date selecting preview keyboard shortcuts up down insert or enter delete builtin support for inline image file insertion into textareas new in 6x improved ui tabbed interface for file operations resizable workspaces ftplike directory navigation log messages additional keyboard shortcuts home end ctrl a r esize t humbnails u pload multiple file selection using ctrl or shift ajax file operations operate on multiple files at a time directory caching themable layout using tpl files improved configuration profiles multiple personal or shared directory assignments for users permissions per directory option to use total user quota together with the directory quota replace method options for existing files multiple thumbnail definitions new integration api for wysiwyg editors installation 1 copy imce directory to your modules directory 2 enable the module at admin build modules 3 create configuration profiles and assign them to user roles at admin settings imce 4 test it at user userid imce or imce 5 see integration methods to make imce collaborate with your application if it s not already integrated notes when you configure imce for inline image file insertion into textareas there should appear an imce link under each textarea you specified if you are uploading files containing unicode characters it is strongly recommended to use the transliteration module that sanitizes filenames by converting characters from unicode to usascii http drupalorg project transliteration if you are using cck you may want to check the imce cck image module at http drupalorg project imceimage or the file field sources module at http drupalorg project filefieldsources frequently faced issues inaccessible invalid directory or subdirectory in some server configurations manually ftp or directly created directories may not be writable by php by imce in this case you have to set the chmod permissions of the directory to 0777 in order to make it writable by anyone you should also make sure that in each configuration profile all of the defined directories are located under drupal s file system path which is usually files and also if safe mode restriction is active in your server don t expect imce to run flawlessly disappearing images after node submission having nothing to do with imce it appeared many times in issue queues this is an input filtering issue that can be resolved by adding tag into the default input format using full html is another solution see admin settings filters no browse button in ie ff at all probably talking about tinymce or fckeditor see integration methods to learn to integrate it by yourself upload does not work in opera jquery form plugin before version 209 has problems with opera 92 replace drupal s misc jqueryformjs with the one at http jquerymalsupcom form download imce may have problem working with google analytics and secure pages modules just make sure to add imce path to the exceptions list of these modules integration methods if you are using wysiwyg module you must also download and install http drupalorg project imcewysiwyg bridge module and enable imce as a plugin in wysiwyg settings here are the applications whose users are lucky that they don t have to read the details of integration methods bueditor obviously the author knows how to integrate imce to his application users need nothing to do fckeditor without wysiwyg another module from another blessed author which makes imce integration as simple as a single click fckeditor profile file browser settings imce integration note one can also override the settings at advanced settings custom javascript configuration here are the lines that force imce integration don t force unless you need to linkbrowser true imagebrowser true flashbrowser true linkbrowserurl q imce app fckeditor url txturl imagebrowserurl q imce app fckeditor url txturl width txtwidth height txtheight flashbrowserurl q imce app fckeditor url txturl there may be other applications that integrated imce already if your application is not one of them please keep reading let s create a case and embody the imce integration on it an application named myapp has an url field for file url has a browse button with click event this can be a text link or anything that is clickable now let s go through the integration methods and define the openfilebrowser function that opens imce and makes it fill our url field on file selection integration by url when imce is opened using an url that contains app applicationname fileproperty1 fieldid1 fileproperty2 fieldid2 the specified fields are filled with the specified properties of the selected file avaliable file properties are url name size formatted width height date formatted bytes integer size in bytes time integer date timestamp id file id for newly uploaded files 0 or integer relpath rawurlencoded path relative to file directory path in our case we should open imce using this url q imce app myapp url urlfield which contains our application name and our url field id function openfilebrowser windowopen q imce app myapp url urlfield width 760 height 560 resizable 1 that s all we need leave the rest to imce it will automatically create an operation tab named send to myapp that sends the file url to our url field clicking the files in preview do the same thing as well what if we had another field for another file property eg size we should have opened imce using this url q imce app myapp url urlfield size filesize using imceload you can point a predefined function to be executed when imce loads when the url is like app myapp imceload myonloadfunc imce looks for myonloadfunc in the parent window and executes it with the window parameter referring to imce window function myonloadfunc win any method of imce is available through winimce winimcesetsendto give it to myapplication baby myfilehandler you should also define myfilehandler using sendto you can point a predefined function to which the selected files are sent when the url is like app myapp sendto myfilehandler imce calls myfilehandler function of the parent window with file and window parameters function myfilehandler file win urlfieldid val fileurl insert file url into the url field winclose close imce usually sendto method is easier to implement on the other hand imceload method is more flexible as you manually add your sento operator and also can do any modification before imce shows up advanced integration in case your application wants to go beyond the simple give me that file property interaction with imce your application wants imce to send multiple files to it eg a gallery application your application wants to gain total control over imce then you should consider applying advanced integration the initial step of advanced integration is the same as imceloadintegration above we open imce and set its imceonload function windowopen q imce app myapp imceload initiatemyapp width 760 height 560 resizable 1 initiatemyapp win will run when imce loads now we define our initiator function in which we do the necessary manipulations to imce interface initiatemyapp function win var imce winimce use imce methods to add remove change things allright but what do we add romeve change in imce depends on our goal here are some properties and methods that can help us to achieve it hooks imcehooksload an array of functions that run after imce loads they are called with the window parameter imcehookslist an array of functions that run while processing the file list each row of the file list is sent to these functions imcehooksnavigate an array of functions that run after a directory is loaded parameters sent are data from ajax or cache olddirectory cached boolean that states the data is from the cache or not imcehookscache an array of functions that run just before a new directory is loaded parameters are cacheddata and newdirectory directory related properties imcetree stores the directory list where imcetree is the root element directory related methods imcediradd directoryname parentelement clickable adds directoryname under parentelement ex imcediradd foo imcedir true imcedirsubdirs directoryname subdirectories adds each subdirectory in subdirectories array under directoryname ex imcedirsubdirs foo bar baz file related properties imcefindex indexed array of files table rows that contain file properties imcefids object containing fileid file name file row pairs imceselected object containing currently selected fileid file name file row pairs file related methods imcefileadd file adds the file object to the list file object has the properties name size bytes width height date timestamp fsize formatted fdate formatted imcefileremove fiileid removes the file having the fileid from the list imcefileget fileid returns the file object having the fileid file object contains name url size bytes width height date time id file id for newly uploaded files 0 or integer relpath rawurlencoded path relative to file directory path file operations imceopadd op adds an operation tab to the interface op contains name title content optional func optional onclick function imceopenable name imceopdisable name enable disable operation tabs miscellaneous imcesetmessage msg type logs a message of the type status warning error note all url strings in the examples start with considering the base path is in case your drupal is running on a sub directory eg http localhost drupal these urls should start with drupal there is a safer solution that does not require manual url fixing if the drupal javascript object is avaliable in your page you can use drupalsettingsbasepath at the beginning of urls drupalsettingsbasepath q imce this won t work multilingual paths with language prefixes file and directory ids names used in imcejs are url encoded forms of original names they are decoded using imcedecode and displayed in the lists ',0);
INSERT INTO `search_dataset` VALUES (44,'help',' readme  id readmetxt v 11 20090223 124916 sun exp summary this module is acts as a bridge between the imce module and the wysiwyg api module for a full description of the module visit the project page http drupalorg project imcewysiwyg to submit bug reports and feature suggestions or to track changes http drupalorg project issues imcewysiwyg requirements imce wysiwyg api installation install as usual see http drupalorg node 70151 for further information configuration enable the imce plugin in the plugins buttons configuration of the wysiwyg profiles of your choice usage please consult the documentation of imce for further information this is just an integration module troubleshooting no known issues yet faq no known issues yet contact current maintainers aaron hawkins http drupalorg user 128806 daniel f kudwien sun http drupalorg user 54136  ',0);
INSERT INTO `search_dataset` VALUES (45,'help',' readme  id readmetxt v 1522 20090621 034303 sun exp summary jquery ui http uijquerycom is a set of cool widgets and effects that developers can use to add some pizazz to their modules this module is moreorless a utility module that should simply be required by other modules that depend on jquery ui being available it doesn t do anything on its own for a full description of the module visit the project page http drupalorg project jqueryui to submit bug reports and feature suggestions or to track changes http drupalorg project issues jqueryui requirements the jquery ui library installation copy the jqueryui module directory to your sites all modules directory download the latest jquery ui 16 development package from http codegooglecom p jqueryui downloads list can 3 q 16 extract it as a subdirectory called jqueryui in the jqueryui folder sites all modules jqueryui jqueryui enable the module at administer site building modules jquery ui 17 the jquery ui module uses jquery ui 16 because jquery ui 17 requires at least jquery 13 which is not shipped with drupal 6 if you absolutely need to move to jquery ui 17 you can get around this by doing the following install the jquery update module appropriately from http drupalorg project jqueryupdate download the latest jquery ui 17 development package from http codegooglecom p jqueryui downloads list can 3 q 17 replace the old jquery ui folder with the 17 package at sites all modules jqueryui jqueryui api developers who wish to use jquery ui effects in their modules need only make the following changes in your module s info file add the following line dependencies jqueryui this will force users to have the jquery ui module installed before they can enable your module in your module call the following function jqueryuiadd files for example jqueryuiadd array uidraggable uidroppable uisortable jqueryuiadd uisortable for a single file see the contents of the jqueryuixx subdirectory for a list of available files that may be included and see http uijquerycom docs for details on how to use them the required uicore file is automatically included as is effectscore if you include any effects files contact current maintainers jeff robbins jjeff angela byron webchick addison berry add1sun daniel f kudwien sun http drupalorg user 54136  ',0);
INSERT INTO `search_dataset` VALUES (46,'help',' readme  id readmetxt v 11421 20090724 175208 dww exp the signup module allows users to sign up for nodes of any type for each signupenabled node this module provides options for sending a notification email to a selected email address upon a new user signup good for notifying event coordinators etc and a confirmation email to users who sign up when used on eventenabled nodes http drupalorg project event or nodes that have a cck date field http drupalorg project date it can also send out reminder emails to all signups x days before the start of the event per node setting and automatically close signups x hours before their start general setting there are settings for restricting signups to selected roles and content types there is support for both registered and anonymous users to sign up both can receive confirmation and reminder emails and registered users are optionally able to cancel or edit their own signups and view listings of their current signups there is extensive integration with the views module http druaplorg project views and also support to embed the signup form as a pane using panels http druaplorg project panels some addon modules that enhance the basic functionality are available in the modules subdirectory and there is a listing of other addon modules on the signup project page http druaplorg project signup for installation instructions see installtxt for instructions on upgrading see upgradetxt for information about theming see theme readmetxt send feature requests and bug reports to the issue tracking system for the signup module http drupalorg node add projectissue signup for a list of future work also see http groupsdrupalorg node 5044 this module was originally codeveloped by chad phillips and jeff robbins and sponsored by jeff robbins it is now being maintained by derek wright http drupalorg user 46549 aka dww  ',0);
INSERT INTO `search_dataset` VALUES (47,'help',' readme tinymce extended is designed to use the hooks in the wysiwyg module and the extendedvalidelements argument to allow the tinymce editor to use extra bits of html markup this module was written as a quick and dirty fix to allow the use of to include google maps into drupal nodes without having to install the various gmap modules which have lots more functionality but are overkill for most copy paste bloggers see discussion here http drupalorg node 544032 happy to turn this into an official drupal module if there s enough demand although seems overkill for one editor and one function comments feedback welcome http bitly 6uorqz security warning nb this does open security holes on your website as all sorts of good and bad code can be called into your site pages using iframes make sure the profile that has access to iframes is limited to trusted users only do not enable this option on profiles available to insecure users for better finegrained control of input formats check out the better formats module http drupalorg project betterformats dependencies wysiwyg tinymce library installed tinymce profile enabled install can t stress this enough do not let anonymous users have this type of access otherwise you re asking for trouble your site could potentially host all sorts of nasties that would infect other sites the best option is to create a new profile specifically for the most trusted users and only enable this option for them here administer site configuration input formats 1 copy the tinymceextended folder to the modules folder in your installation 2 enable the module using administer site building modules admin build modules 3 enable the function in wysiwyg s tinymce profile go to administer site configuration wysiwyg and click edit for the tinymce profile that you want to access tags expand the buttons and plugins option and tick the option for iframe fix which should be near the bottom 4 if your site has heavy caching it might be worth clearing the cache to make sure it s all working go to administer site configuration performance and click on the clear cached data button near the bottom of the page  ',0);
INSERT INTO `search_dataset` VALUES (48,'help',' readme  id readmetxt v 16 20081028 224605 sun exp summary wysiwyg api allows to users of your site to use wysiwyg richtext and other clientside editors for editing contents this module depends on thirdparty editor libraries most often based on javascript for a full description visit the project page http drupalorg project wysiwyg bug reports feature suggestions and latest developments http drupalorg project issues wysiwyg requirements none installation install as usual see http drupalorg node 70151 for further information go to administer site configuration wysiwyg and follow the displayed installation instructions to download and install one of the supported editors configuration go to administer site configuration input formats and either configure the full html format assign it to trusted roles and disable html filter line break converter and optionally url filter or add a new input format assign it to trusted roles and ensure that above mentioned input filters are disabled setup editor profiles in administer site configuration wysiwyg contact current maintainers daniel f kudwien sun http wwwunleashedmindcom previous maintainers nathan haug quicksketch http quicksketchorg kreynen http drupalorg user 48877 allie micka http drupalorg user 15091 theodore serbinski m3avrck http drupalorg user 12932 nedjo rogers nedjo http drupalorg user 4481 steve mckenzie http drupalorg user 45890 ufku http drupalorg user 9910 matt westgate and jeff robbins richard bennett this project has been sponsored by unleashed mind specialized in consulting and planning of drupal powered sites unleashed mind offers installation development theming customization and hosting to get you started visit http wwwunleashedmindcom for more information  ',0);
INSERT INTO `search_dataset` VALUES (49,'help',' overview calendar 20 for drupal 6 calendar 20 for drupal 6 entailed a complete rewrite in order work with views 2 there are a lot of changes from earlier versions so i strongly suggest you start with the default calendar view provided and add and edit it to get the results you want  ',0);
INSERT INTO `search_dataset` VALUES (50,'help',' getting started create a new calendar by enabling the default calendar view and changing it to use whatever date you want in your calendar you can create multiple calendars by cloning the default calendar view as many times as necessary the calendar uses the generic date argument  this argument has an option to select one or more views date fields to filter on automatically adds them to the view and then filters the view by the value of the selected field s this argument can be used on any view not just calendar views unlike previous versions of the calendar module there is just a single argument instead of year month and day arguments the argument value will be yyyymmdd for a day yyyymm for a month yyyy for a year and yyyyw99 for a week there is a default option to set the argument to the current date when the argument is empty a calendar display creates calendar navigation and links to multiple displays for the year month day or week views the actual displays are created by attaching calendar views that use whatever styles are desired for those pages calendar views are attachments  note 1  to create the year month day and week displays they can be set to use any style either a calendar style or any other views style like teasers or lists they can each have their own fields and formatting they must be attached to the main calendar page or to a calendar block if you don t want to have a link to a week display just remove the week display from the view ditto for any other displays you don t want to use the links will automatically disappear for any displays that are not defined in the view a calendar block will create a calendar block for the view results this block requires the calendar argument to do its work and uses one of the year month day or week calendar view attachments created above earlier versions required that you add the date field to the fields section of the view but this version does not require that add the field to the view if you want it displayed in the results otherwise you can leave it out the calendar no longer overwrites normal formatting for that field it will be displayed however you set it up in the view there are templates for the top of the calendar the links and navigation the year month day and week displays and the individual month week and day nodes so you can easily style them  ',0);
INSERT INTO `search_dataset` VALUES (51,'help',' settings calendar settings are now all done in the view instead of on a separate settings page in the administration area see the screenshots below for the place to edit the legend colors  ',0);
INSERT INTO `search_dataset` VALUES (52,'help',' attachments views 2 lets you combine a number of displays together in one view including potentially more than one page display each page display can be a regular page display with its own url or an attachment to another display attachments are basically one or more views that all appear at the same url of the page they are attached to one after the other so the calendar now creates one display that creates the back next navigation and attaches to it a year month week or day display with the calendar for the right period  ',0);
INSERT INTO `search_dataset` VALUES (53,'help',' embedding views embedding views embed a date browser or calendar view anywhere using the format dateembedview viewname displayname settings args settings are used to override some values of the view the primary setting that is useful here is a setting for blockidentifier the view s blockidentifier is used to control individual instances of regular and embedded views that contain date navigation so that they move separately or together all views that use the same identifier will move together all views that use different identifiers will move independently the identifier will show up in the url as a querystring like node 275 mini calendar 200810 page views use no block identifier the normal identifier of the block view is mini  examples   php print dateembedview calendar calendar1 this will embed the default page view of the calendar using the regular calendar defaults php print dateembedview calendar calendar1 array blockidentifer embedded array 2008w45 this will embed the page view of the calendar that will use embedded as an identifier set to show the week view for week 45 of 2008 php print dateembedview calendar calendarblock1 array blockidentifier mini array 200807 this will embed the block view of the calendar that will use mini as an identifier set to show the month view for july 2008  ',0);
INSERT INTO `search_dataset` VALUES (54,'help',' ical the calendar module can take advantage of the ical standard to either export or import ical feeds ',0);
INSERT INTO `search_dataset` VALUES (55,'help',' ical export if the calendar ical module is enabled the default calendar view will include an ical display that you can use to create ical exports of your calendar to use the ical export look for the ical display in the calendar the default ical feed uses a date filter set to show events greater to or equal to now find the date filter on the ical display and change it to use the date s used in the calendar then attach the ical feed to the calendar page and or the calendar block  ',0);
INSERT INTO `search_dataset` VALUES (56,'help',' ical import to import nodes from an ical feed follow the ical import instructions after importing the imported nodes now exist as regular date fields that can be added to your calendar  ',0);
INSERT INTO `search_dataset` VALUES (57,'help',' readme please read this file and also the installtxt they contain answers to many common questions if you are developing for this module the apitxt may be interesting if you are upgrading check the changelogtxt for major changes description the pathauto module provides support functions for other modules to automatically generate aliases based on appropriate criteria with a central settings path for site administrators implementations are provided for core content types nodes taxonomy terms and users including blogs and tracker pages pathauto also provides a way to delete large numbers of aliases this feature is available at administer site building url aliases delete aliases benefits besides making the page address more reflective of its content than node 138 it s important to know that modern search engines give heavy weight to search terms which appear in a page s url by automatically using keywords based directly on the page content in the url relevant search engine hits for your page can be significantly enhanced installation and upgrades see the installtxt file notices pathauto just adds url aliases to nodes users and taxonomy terms because it s an alias the standard drupal url for example node 123 or taxonomy term 1 will still function as normal if you have external links to your site pointing to standard drupal urls or hardcoded links in a module template node or menu which point to standard drupal urls it will bypass the alias set by pathauto there are reasons you might not want two urls for the same content on your site if this applies to you please note that you will need to update any hard coded links in your nodes or blocks if you use the system path ie node 10 for menu items and settings like that drupal will replace it with the urlalias for external links you might want to consider the path redirect or global redirect modules which allow you to set forwarding either per item or across the site to your aliased urls urls not getting replaced with aliases please bear in mind that only urls passed through drupal s l or url functions will be replaced with their aliases during page output if a module or your template contains hardcoded links such as href node node nid those won t get replaced with their corresponding aliases use the drupal api instead href url node node nid or l your link title node node nid see http apidrupalorg api head function url and http apidrupalorg api head function l for more information disabling pathauto for a specific node type or taxonomy when the pattern for a node type is left blank the default pattern will be used but if the default pattern is also blank pathauto will be disabled for that node type bulk updates must be run multiple times as of 5x2x pathauto now performs bulk updates in a manner which is more likely to succeed on large sites the drawback is that it needs to be run multiple times if you want to reduce the number of times that you need to run pathauto you can increase the maximum number of objects to alias in a bulk update setting under general settings wysiwyg conflicts fckeditor tinymce etc if you use a wysiwyg editor please disable it for the pathauto admin page failure to do so may cause errors about pregreplace problems due to the tag being added to the strings to replace see http drupalorg node 175772 credits the original module combined the functionality of mike ryan s autopath with tommy sundstrom s pathautomatic significant enhancements were contributed by jdmquin wwwbcdemsnet matt england added the tracker support other suggestions and patches contributed by the drupal community current maintainers greg knaddison http growingventuresolutionscom mike ryan http mikeryanname frederik freso s olesen http fresodk changes see the changelogtxt file id readmetxt v 116 20080621 182038 greggles exp  ',0);
INSERT INTO `search_dataset` VALUES (58,'help',' readme slideshowmodule id readmetxt v 16 20061225 163548 timcn exp description slideshowmodule provides basic slideshow capabilities it transforms images attached to nodes to a javascript enabled slideshow if the user does not have javascript enabled it degrades to a regular slideshow where the next button points to the next image and a whole new page is loaded any post can contain a slideshow enable slideshow for a content type at administer content management content types content type features convenient just attach an image to the slideshow node lightweight the javascript file weighs only 16 kb themable just modify three small theme functions usable users with javascript enabled don t have to reload the page installation just copy the folder to your modules folder and activate the module in your drupal installation if you do not have enabled the upload module do it now as this module obviously depends on it configuration also you need to configure the uploadmodule properly make sure that the path specified unter administer settings file system settings exists the default installation does not come with the preconfigured files directory you have to create that directory manually or specify another directory name that exists if you don t want to see the files listing below the content of the slideshow you have to uncheck the checkbox in the list column left to each file in the attachments table development due to it s simpleness slideshowmodule doesn t provide a bunch of features it just does what it s supposed to do it doesn t have transitions or a lot of settings you can change slideshowmodule is in development there are some features i d like to implement that aren t available yet planned features include the possibility to rearrange images to include images from image nodes a more flexible image resize system if you have suggestions don t hesitate to post your suggestions as an issue on drupalorg feel free to supply patches i ll definitely review them and roll them in if they are sensible enhancements to this module  ',0);
INSERT INTO `search_dataset` VALUES (59,'help',' readme  id readmetxt v 1161 20090419 213124 greggles exp description token module provides a centralized api for text substitution unless you re installing another drupal module that requires it this software is probably unnecessary for more information on tokens see http groupsdrupalorg tokens benefits if you re a drupal developer check out apitxt for detailed instructions on using the token api it allows every module to announce the placeholder tokens they can handle uses simple caching to prevent duplicated work in a given pageview and is pretty lightweight it s nice you ll like it tokenstarter want to add your own custom tokens to a site not sure how to write a module worry no more it s now quite easy 1 copy and rename the tokenstarterinfo and tokenstartermodule replacing every instance of starter with a descriptive appropriate word 2 edit the module file and change hooktokenlist and hooktokenvalues to provide whatever additional tokens or logic your site needs 3 enable the module and enjoy you should also want to read the apitxt ',0);
INSERT INTO `search_dataset` VALUES (60,'help',' what is views  the views module allows administrators and site designers to create manage and display lists of content each list managed by the views module is known as a view and the output of a view is known as a display displays are provided in either block or page form and a single view may have multiple displays optional navigation aids including a system path and menu item can be set for each pagebased display of a view by default views may be created that list content a node view type content revisions a node revisions view type or users a user view type a view may be restricted to members of specific user roles and may be added edited or deleted at the views administration page the building block design of the views system provides power and flexibility allowing parameters to be specified only when needed while an advanced view may use all of available parameters to create complex and highly interactive applications a simple content listing may specify only a few options all views rely on a conceptual framework that includes  fields  or the individual pieces of data being displayed adding the fields node title   node type  and node post date to a node view for example includes the title content type and creation date in the displayed results relationships  or information about how data elements relate to one another if relationship data is available like that provided by a cck nodereference field items from a related node may be included in the view arguments  or additional parameters that dynamically refine the view results passed as part of the path adding an argument of node type to a node view with a path of content for example dynamically filters the displayed items by content type in this example shown with clean urls enabled accessing the view through the path  http wwwexamplecom content page  displays all posts of the type page the path  http wwwexamplecom content story  displays all posts of the type story and  http wwwexamplecom content  displays all posts regardless of type  sort criteria  which determine the order of items displayed in the view results adding the sort criteria node post date  in descending order to a node view  for example sorts the displayed posts in descending order by creation date filters  which limit items displayed in the results adding the filter node published  and setting it equal to published to a node view for example prevents unpublished items from being displayed displays  which control where the output will be seen every view has a default display which doesn t actually display the view anywhere but is used to hold the default settings for the view and is used when the view is called programmatically if another display is not specified much more useful to users are the page display which gives a view a path and allows it to be the primary content of a page or the block display which allows it to appear as secondary content on other pages  ',0);
INSERT INTO `search_dataset` VALUES (61,'help',' getting started for those new to views it can be a complex system that appears totally overwhelming the good news is that the ui is designed to compartmentalize everything this means that for the most part you can ignore the parts you re not interested in start small and build your way up because of this the edit ui can seem overwhelming at first but there are really just a few things you have to know the rest you can find through exploration the views edit ui image below gives an overview of what you ll find on the edit ui the views edit ui notes 1 every view has a number of displays which represent where output will be placed if you re familiar with the original views 1 you could set a view to be a page with a url path or a block that could show up in a sidebar with views 2 you can add as many displays as you like in addition you have the default display which contains the basic settings but doesn t actually show up anywhere 2 when you click on the link for an item a form will open up for browsers with smaller resolutions you may have to scroll down a little to see this form if a form is open the item its attached to will be highlighted 3  overrides mean that a particular display is not using default settings when you create a new display many of its settings will start off using default values this will be indicated by italics and a lighter color if you change these values without first overriding them you will change the default value for all displays that use them 4 some items particularly styles have additional settings ordinarily when you update a style if it has additional settings you will automatically see that form next often you will need to go directly to those settings 5 you can safely leave a view page to go and do other things if you come back the view will still be there stored in a cache keep in mind however that while you do this that view is locked  meaning another user cannot edit this view without breaking the lock breaking the lock will discard your changes it helps to have something particular in mind that you want to accomplish when using views here are a couple of ideas and a brief sketch of how to accomplish what you want  ',0);
INSERT INTO `search_dataset` VALUES (62,'help',' create a page to list users by role in this example you will create a page view listing users on your site through this stepbystep process you will become familiar with some basic steps in creating a view and familiarize yourself with the views user interface creating a new view go to add new view  give your new view the name userlist description a simple user listing tag users type user and click next  about the interface you have been brought to the views user interface as you start you are editing the default options for the view in the 1st column on the left you can see the dropdown menu offers block for example to select settings specific only to block views in the remaining columns you will be able to add or change options by clicking on links or icons these options will then appear below this main area most likely you will need to scroll to see the options appear as you make changes these options will appear in bold until you save your view creating a page display choosing a url and creating a menu link in the 1st column ensure that page is selected in the dropdown menu and click add display  next we ll define the path for this page a page must have a path and we define it early so that views doesn t warn us display page uses path but path is undefined locate the page settings in the 2nd column and click the none link next to the path setting in the options editing area that appears below set the path to userlist or something else if you prefer and click update  next to menu setting click the no menu link in the options which appear below select normal menu entry  and set the title to user list and click update  scroll up to basic settings  in that same 2nd column and click the no link next to use pager  below in the options select full pager and click update default display  selecting the fields to display in 3rd column locate the fields options click the   icon to add fields scroll down to defaults add fields  in the groups dropdown menu select user then check the following fields  user created date   user delete link   user edit link   user last access   user name and user picture  then click add  you will be taken through the fields you added one at a time click update default display to go to each next field leave the default options on all fields except delete link  change that field s label to operations scroll back up to fields and click the  uarr darr  icon to rearrange fields down below drag the name field by dragging its foursided arrow to the top drag the delete link operations  field to the bottom and the edit link field just above it then click update  seeing what we ve done so far at this point you have done enough to create a valid view if you scroll down you will see a preview of your view if it doesn t show already click the preview button but generally this display updates automatically whenever you finish working in one of the mini forms styling the view as a table combining related fields into columns under basic settings  in the 1st column click the unformatted link next to the style setting in the options below under page how should this view be styled  choose table and click update default display  you will be taken to a page style options form to edit the table settings locate our edit link field in this mini form and notice the column dropdown change this dropdown to show operations  in the separator column next to the operations field type note the spaces around the   symbol check all of the sortable checkboxes and set default sort to name  when finished click update default display  filtering the user list to exclude unwanted entries click the   icon next to filters  in the groups dropdown menu select user then check the user name filter and click add  select is not one of and enter anonymous in the usernames box click update default display  adding an argument to list users by role dynamically scroll up to arguments  and click its   icon check the user roles argument and click add  set the title to 1 don t type the quotes and under action to take if argument is not present select summary sorted ascending  leave the other settings as they are click update default display  and click update through the prompts that follow to accept their default values saving the view finally click the save button to save your work at the very top click view page  to go to your new view  ',0);
INSERT INTO `search_dataset` VALUES (63,'help',' create a block of recent stories in this example you will create a list of nodes of the content type story to be shown in a block through this stepbystep process you will become familiar with some basic steps in creating a view and familiarize yourself with the views user interface creating a new view go to add new view  give your new view the name recentstories description recent stories tag story type node and click next  about the interface you have been brought to views user interface as you start you are editing the default options for the view in the 1st column on the left you can see the dropdown menu offers block for example to select settings specific only to block views in the remaining columns you will be able to add or change options by clicking on links or icons these options will then appear below this main area most likely you will need to scroll a bit to see the options appear selecting the fields to display in 3rd column locate the fields options click the   icon to add fields scroll down to defaults add fields  in the groups dropdown menu select node then check the following two fields  node post date   node title  then click add  you will be taken through the fields you added one at a time make the changes specified below for the post date field delete the post date label change the date format to custom  and the custom date format to f j y g i a do not type the single quotes for the meaning of these letter codes click on the php docs link under that box to arrive at the explanation click update  for the title field delete the title label select link this field to its node click update  scroll back up to fields and click the  uarr darr  icon to rearrange fields drag the foursided arrow next to node title so that it appears above node post date  click update to save the new field order filtering to story nodes only click the   icon next to filters  in the groups dropdown menu select node then check the node published and node type filters and click add  select the published checkbox click update select is one of and check story in the node type field click update  sorting to show most recent first scroll up to sort criteria and click the   icon in the groups dropdown menu below select node then check node post date  and click add  alternatively you may instead check node last comment time  or node updated commented date  or node updated date  select descending sort order  click update  refining the basic settings in 1st column under basic settings locate these options  items to display setting click 10  change the 10 to 4 click update style setting click unformatted  change to list  click update  adding a block display for custom options in the dropdown on the left ensure that block is selected and click add display  under block settings  click the none link next to the admin setting change block block admin description to recent stories  saving the view click save to save your work instructing drupal to show the block finally you should tell drupal to show this block configure your block by going to admin build block  locate the block in the list it is labeled recent stories  place this block in a region and click save  you may click configure to set a different title to determine which roles can view the block and on which pages it appears if you want your block on the front page only enter front  ',0);
INSERT INTO `search_dataset` VALUES (64,'help',' create an rss feed of user posts in this example you will create a feed display to show nodes by individual users dynamically selected through the url you will become familiar with the views 2 interface as well as learn how to use an argument to pull in a user name and use it in a dynamically created path a feed is a data format that places your site s content into a file that can be read and displayed by news reader programs when visiting a site you may notice a small rss transmission icon  whereby clicking on it you can subscribe to the site s most recent content this makes it easier for your visitors to keep up to date with your website you can also use this format to aggregate information into other sites for more information please watch a video from common craft about rss in plain english  note drupal automatically creates a feed for your website but you may want to create feeds with specific information in this case a list per user creating a new view go to add new view  give it the name userfeed description a feed of user nodes tag users type node and click next about the interface you have been brought to the views user interface as you start you are editing the default options for the view in the 1st column on the left you can see the pulldown menu offers feed for example to select settings specific only to rss views in the remaining columns you will be able to add or change options by clicking on links or icons these options appear below this main area most likely you will need to scroll to see the options appear as you make changes these options will appear in bold until you save your view change default display under basic settings in the 2nd column click row style fields a menu loads below  defaults how should each row in this view be styled  check the node option and click update  this loads another options menu  defaults row style options click update  create the rss view in the 1st column select feed in the dropdown menu and click add display  under basic settings in the 2nd column click row style missing style plugin note options appear below the views interface you may need to scroll to see feed how should each row in this view be styled tick node  then update this loads the next options menu display type  select use default rss settings click update  set the path for accessing your feed in the 2nd column under feed settings  click path none in options below feed the menu path or url of this view enter in the path with an argument feeds rssxml click update set up your arguments to say which user s nodes to display to the right of arguments  click the sign to add and argument in the feed add arguments menu that loads below select user in the pulldown menu check the box user name  click add scroll down to options to find case in path  select lower case check the box transform spaces to dashes in url click update default display sort to show most recent at top of feed scroll up to sort criteria in the right most column and click the icon in the groups dropdown menu below select node then check node post date  and click add  select descending sort order  click update  set filters to hide unpublished entries click the icon next to filters  in the options below select node under groups dropdown menu choose the node published filter and click add  check the box published  click update default display test click save under live preview type in the name of a user in lowercase replacing spaces with dashes click preview  you should test and find your feeds at urls like http yoursitecom feeds username rssxml you can use this path for aggregating on another site you can also attach the rss feed to another display of view to make the feed link appear on that display  ',0);
INSERT INTO `search_dataset` VALUES (65,'help',' create a block of author s recent blog posts in this example you will create a contextsensitive block that shows the titles of recent blog entries by an author when viewing one of their posts this will demonstrate using views arguments to dynamically filter a view s contents at display time before working through this example enable the blog module and populate some entries from a few different users creating the view the first step is creating a view for our recent blog entries block because the block will show the titles of blog entries this view is considered a node type go to add new view  enter the following properties and click next  view name recentblogentries view description list of recent blog entries for a given author view tag blog view type node generating a list of blog entries it will be much easier to see the view progress if we can see it doing something in this section we will create a basic view displaying blog entry titles in the third column locate the fields area generally speaking fields are the pieces of information that you want to display in the view in this case node title click the   icon to add a field scroll down to defaults add fields  below the settings table a large selection of fields will be available in the groups dropdown menu select node  this will limit the list to only the default fields exposed by node module scroll down the list select the node title field and click add  you will now be presented with settings for the node title field delete the label from the label field so that each individual node title is not prefixed with the word title additionally check the link this field to its node box so that visitors who see an interesting title can click directly on it to read the blog entry to which it belongs when finished click update  if you scroll down to the live preview section you should now see a list of several node titles however both blog entries and other node types will be in the list let s fix that in the fourth column locate the filters area filters limit the results displayed in the view and we can use this to our advantage here by showing node titles only from blog entries and not every type of node click the   icon to add a filter as before scroll down to the defaults add filters section select node from the groups select box to limit the list of options to only those exposed by node module scroll down and select the node type field and click add  in the settings page that appears leave operator as is one of and select blog entry under node type  click update when finished now by scrolling down to live preview  you ll see that the list only shows blog entries adding context with arguments while filters are very useful for limiting the results of a view when the condition is always consistent for example a view of blog entry nodes should always be filtered by the blog entry type something filters can t do is smart decisionmaking based on the page context in our case we want the view to display a different list of blog entries when looking at a post by user admin than we do when looking at a post by user member and filters won t be able to help luckily there s another way to filter a view s content  arguments  through arguments views are able to obtain additional context typically via dynamic urls with ids in them and can take this context into consideration when displaying the view let s walk through adding and configuring an argument to our view so that we can change its contents based on post author in the third column locate the arguments area click the   icon to add an argument because we are basing the view around content authors  this time under groups select user  check user uid and click add  the defaults configure argument user uid settings page has a lot going on but only a few things that need our attention the title field here unlike the title field under basic settings  can be based upon the context that the view is being displayed in change the title to recent entries by 1 1 will later be expanded to the user s name based on the user uid argument when the view is displayed under action to take if argument is not present  there are a variety of options ranging from displaying a 404 or a 403 page to simply displaying all values in the view in our case if an argument isn t specified which it won t be since this view will be displayed in a sidebar block not as a page with its own url we want to give it a default one to act on select provide default argument  assuming javascript is enabled in your browser you should now get another selection for default argument type  select user id from url  which will then provide a new option  also look for a node and use the node author  select it this will cause views to first see if it can figure out a user id from the current url for example user 1 if it can t it will instead check to see if the current page is a node page such as node 42 and if so take the user id from the node s author field instead validator options provide a useful way to control what kind of arguments your view will accept select user as the validator  by default changing this setting will check the incoming argument and ensure it s a valid user id if not the view will be hidden from the page once you have changed the argument s title default argument and validator options click update to save your changes you ll notice that now the live preview no longer shows anything did we just break the view fortunately no it s merely abiding by our wishes to hide itself if there is no valid user id given to it try entering a 1 in the arguments box and clicking preview  you should now see a list of only user 1 s blog entries creating the block so the live preview is now showing basically what we want there s just one problem we have no way to stick what we ve done so far into a sidebar block let s fix that by adding a new display  in the first column under defaults  there is a select box containing entries such as page   feed  and yes  block  select block and click add display  there s not much else to do here as far as views is concerned under block settings  click the none link next to admin and fill in a description for the block in the administrative interface such as recent blog entries by author and click update  save your work by clicking the save button at the bottom of the views interface you should receive a message that the view has been saved next navigate to the blocks interface and drag the recent blog entries by author block to the right sidebar region or similar and click save blocks  you ll notice this appeared to do nothing no block shows in the sidebar but remember we are looking at an adminitrative page we are not looking at a page that would provide a user id context navigate to the main blog listing and click on an entry there you should now see a sidebar block titled something like recent entries by admin with a list of blog entries beneath it finishing touches there are still a few remaining things to do before our view is complete for example we said that the block was to show recent blog entries but instead it s showing them in the order they were entered with oldest on top additionally even unpublished entries are showing in the list currently return to the recentblogentries view edit page  add an additional filter by clicking the   icon in the filters section in the fourth column change groups to node and select node published  click add  under the published selection choose yes and click update  to handle sorting locate the sort criteria area just above filters and click the   icon there under groups  again select node  from the list of options check node post date and click add  in the settings page change sort order to descending  this will place the newer posts on top of the older ones click update when finished finally  save the view for your new settings to take effect  ',0);
INSERT INTO `search_dataset` VALUES (66,'help',' view types the view type describes how this view is stored views is capable of having views entirely in code that are not in the database this allows modules to easily ship with views built in and it allows you to create a module to store your views for easy deployment between development and production servers normal normal views are stored in your database and are completely local to your system default default views are stored only in code and are not anywhere in your database they may be enabled or disabled but you may not completely remove them from your system you can override the view which will create a local copy of your view if you do this future updates to the version in code will not affect your view overridden overridden views are stored both in code and in the database while overridden the version that is in code is completely dormant if you revert the view the version in the database will be deleted and the version that is in code will once again be used you may store your views in code with the following procedure create a module to store the views add the function modulenameviewsdefaultviews  to this module export the view you wish to store in your module in code cut and paste that into the abovenamed function make sure the last line of the view is   views view name view  make sure the last line of the function is return views  after you make any changes be sure to clear the views cache  you may do this from the tools menu  ',0);
INSERT INTO `search_dataset` VALUES (67,'help',' displays displays tell views where the output should go by adding a display to a view you can have your view appear as a page or as a block or even as an attachment to a different display on the view each display can have its own settings but when it s created a display will take all of its basic settings from the default display which all views must have for most settings there is an override button that will override that single setting for the current display overridden settings will have a mark in the summary for that display please keep in mind that when you are editing a setting on a display that is not overridden then by default you are editing that for all displays for fields   arguments   sorts   filters and relationships  you can only override all of them or none of them to do this click on the header for the filters or the rearrange button once you override the display will then have its own copies of the fields filters etc and changes to the defaults will not be reflected on your display ',0);
INSERT INTO `search_dataset` VALUES (68,'help',' default display the default display is primarily a display to store settings and isn t actually used anywhere within the views system it is possible for external programs to use the default display but if they do they will hopefully tell you which display they will be working with the default display is also a convenient display to use to embed into your site using php snippets this is useful for example in node content but this is something that should generally only be done by administrators in general you probably want to add either a page display or a block display   ',0);
INSERT INTO `search_dataset` VALUES (69,'help',' page display page displays have a path and an optional menu component page displays will be the primary content for the page meaning they will be displayed in the main content area when you visit the url that corresponds to the path page displays take their arguments from the url you can embed arguments into the url using in previous versions of views this was arg for example node foo will accept urls such as node 1 foo  ',0);
INSERT INTO `search_dataset` VALUES (70,'help',' block display block displays will show up on your blocks administration page once a block display is created and saved it can be enabled and positioned in your theme by visiting administer site building blocks and selecting it from the list blocks do not accept arguments from any source the only way to get arguments to a block is to provide defaults to it possibly via the php code default setting edit the argument in question you may want to override this argument if you have multiple displays using it change the action to take if argument is not present to provide default argument this will bring up a new box called provide default argument options the most common default argument type used for blocks is node from url where it attempts to determine if the url refers to a node for example if visiting node 1 or node 1 edit user id from url is also very common if you change the default argument type to php code note you must have permission to use php code on your site you can enter php to define the argument needed simply return the argument  ',0);
INSERT INTO `search_dataset` VALUES (71,'help',' attachment display attachment displays are attached to another display in the same view when the display is visited the attached display will also be rendered and may be placed before after or both before and after the original display attachment displays are often useful for displaying an argument summary view along with a page display that accepts arguments this can be used to provide a kind of glossary ',0);
INSERT INTO `search_dataset` VALUES (72,'help',' feed display a feed display allows you to attach an rss feed to a view  ',0);
INSERT INTO `search_dataset` VALUES (73,'help',' arguments arguments are input while they often come from the url  they don t always so please don t be shocked when they don t each display type may have its own source for arguments block displays have no source of arguments at all they cannot pull arguments from the url and often require use of the default argument php code in order to get arguments the argument default plugins can be used to get arguments into a block view see provide default below in general arguments are used to filter the view and in that sense they have a very close relationship to filters but that isn t necessarily true for every argument arguments can be used for any purpose really the extent of what the argument does is up to the developer of the argument but the arguments that come with views are almost entirely filters a typical use of an argument might be to reduce a view to a single node a single user or nodes with a given taxonomy term action to take if argument is not present ignore the argument is removed from the view as though it weren t there and all results will be displayed hide view page not found the view will remove itself entirely if the argument is not present for a block this means it simply won t a appear for page views the view will return a 404 and present a page not found error display empty text the value of the empty text will be displayed summary the view will attempt to display a summary of arguments available based upon the view and provide links to the view with those arguments summaries have their own style handlers as well as options the default summary style simply displays a list of arguments with a count of entries found per argument this special mode is a very powerful part of views provide default if no argument is given a default argument can be selected the method of choosing the default argument is selectable and pluggable wildcards all arguments have a wildcard which is an argument that means to use all values in practice it is the same as ignore above where the argument is simply removed and the view is created without the argument the wildcard title is used in titles and breadcrumb trails default arguments default argument selection is available only if the action to take is provide default   when that is selected a new fieldset will appear letting you choose what the default argument will be views provides the following default selectors by default but other modules may add more fixed entry you may directly enter what the argument will be this is not a variable it will always be the same argument node id from url this will attempt to find a node id from the url and is primarily useful for the node id argument though other arguments that use node ids such as the cck node reference argument will find it useful too for example when visiting the path node 1 or node 1 edit it will know that the 1 in that path is a node id and use it user id from url like node id from url this will attempt to find a user id from the path it also includes an option to look for a node and use the node author as the user id user id from logged in user you can use this to easily default a menu item to the logged in user for example if you created the path blogs and gave it a user id argument with this default blogs would go to the user s own blogs and blogs 1 would go to user id 1 s blogs please bear in mind that the selection of default argument happens only if an argument is not provided if using a display that has no argument source such as a block this will be the case 100 of the time however if using a display that reads arguments from the url this will happen only if the url did not contain an argument argument validation arguments can also have validators which are pluggable systems used to ensure that arguments fit within certain parameters when a validator is chosen it may provide some settings for the validator including the action to take if an argument is presented but it fails to validate these actions are generally the same as the default actions above excluding the ability to provide another default if a view provides a menu option such as a tab if the argument does not validate the tab will not appear this sytem can have other validators plugged in by default views provides basic validation ensures that the argument is present a php null value from eg php default argument code will invalidate node ensure that the argument is a valid node id you may select which types of node the validator will accept taxonomy term ensure that the argument is a valid taxonomy term this includes options to limit to specific vocabularies and can transform the argument to the right type depending upon the actual argument set the argument type option to the actual type of data that the argument being used is expecting php code you may enter arbitrary php code similar to the php block visibility code to determine if the argument is valid or not  ',0);
INSERT INTO `search_dataset` VALUES (74,'help',' fields fields are the individual pieces of data being displayed adding the fields node title   node type  and node post date to a node view for example includes the title content type and creation date in the displayed results fields may not appear on every display because not all style plugins actually use fields for example the node row plugin simply displays the node through drupal s normal mechanisms and fields are not involved for the most part the field settings should be self explanatory fields will appear in the order that they are arranged in and they will usually appear with the label they are given ',0);
INSERT INTO `search_dataset` VALUES (75,'help',' sorts sort criteria determine what order the records are retrieved from the database and displayed in generally all you need to do is pick a field and choose ascending 1 2 3 4 or descending 4 3 2 1 and it will be done if you have multiple sort criteria the second and later items only come into play if the first item is the same different data types sort just a little bit differently from others number fields number fields sort like you would expect 1 comes before 2 which comes before 10 which comes before 100 which comes before 200 etc text fields text fields always sort alphabetically even if the text contains numbers this can have some odd effects if you have numbers stored in text because the values 1 3 7 10 12 20 100 120 will sort like this 1 10 100 12 120 200 3 7 this is because these fields sort purely by characters and not numeric value ie comparing 200 and 3 the 2 comes before the 3 therefore 200 is smaller than 3 date fields date fields often can have a granularity which is a way of making similar dates actually be the same date take two dates that are close to each other  may 1 2007 530 am and may 1 2007 945am  without granularity the two dates are compared and the first date comes before the second date however if the granularity is set to day it only looks at the parts of the date up to the day  may 1 2007 and may 1 2007  at that point they are the same and the sort would move on to the next sort criterion  ',0);
INSERT INTO `search_dataset` VALUES (76,'help',' filters filters are used to reduce the data set that views provides that is to say without any filters applied views will return all of your content you don t want that so at least some filters must be used some very commonly used filters the node published filter is used to restrict a node view to only nodes that are are have the published box checked this can be very important to prevent users from viewing content they should not have access to the node promoted to front page filter can be used to show only nodes that have the promote to front page turned on the node type filter is useful for showing only certain types of nodes let s say you wanted users to see only nodes that were book nodes or a combination of book nodes and staffblog nodes this filter allows you to select exactly that the user current filter will show only nodes that the logged in user has authored the node post date filter can be used to show only nodes posted before after or between a range of dates the above list is only a tiny fraction of the filters available in views referenced here to give an idea of the kinds of tasks filters can accomplish  ',0);
INSERT INTO `search_dataset` VALUES (77,'help',' relationships relationships allow you to expand the query to include objects other than the base query this is actually made more difficult to understand by the fact that views actually includes a few relationships by default and doesn t tell you they re there for historical reasons it would be inconvenient to remove these default relationships when relationships are present all fields including relationships will gain a new form item to let you select which relationship they will use they will default to using no relationship at all the main example of the relationship that is there by default is the node user relationship every node has an author and if a node is in the query the user who wrote that node is automatically made available note the author considers it an error that this relationship is automatic but by the time it was realized this was in error it was too late to change it a similar relationship that is not automatically made available is for node revisions each revision has its own author which is the user who made the revision by adding the node revision user relationship all of the user fields sorts filters and arguments available to a user will now be available for the revision author when a relationship is added to the view all applicable items will gain a relationship select box where you can choose which version of that particular item you wish to use this can be illustrated with an example a comment view contains the relationships comment node and comment user this means that all the fields for the node that a comment is attached to are available and all the user fields for that node author also become available the other relationship makes fields for the author of the comment available very often not the author of the node when you add the user name field you will be presented with a select box either the node relationship or the user relationship must be selected because there are two possible user names in the view to choose from another example of relationships involves the files table in drupal files are related to users but files are not necessarily related to nodes however the uploadmodule allows some files to be attached to nodes the only way for views to deal with this discrepancy is with relationships when creating a node view it s possible to add an uploaded files relationship to get file data for nodes that were attached with the upload module it is also possible to go the other way from a files view you may add a relationship via the upload table to view information about the node  ',0);
INSERT INTO `search_dataset` VALUES (78,'help',' output styles view styles  the views  style system is how you customize the output produced by your view a view style is basically a smart theme template that processes the view data and then outputs it all styles in views can be overridden by placing copies of the templates in your theme directory and then modifying them see the theme information link available on all views to get hints for which templates a given view is using a breakdown of view output by default the style is unformatted  which means that there is very little style actually used the records are simply displayed one after another enclosed in a div tag so that you can use css to manipulate the view  some styles use a separate row style to determine how each row of the view looks this is useful for mixing and matching styles to more readily produce exactly the kind of output you need many styles can be grouped  for styles that can there will be a grouping field option pick one of the fields to group by this grouping field will be displayed as a header and all rows will be displayed beneath it each style is its own entity ',0);
INSERT INTO `search_dataset` VALUES (79,'help',' view row styles a row style is an individual style to display only an individual record within a view for example a node type view would display one node per row a user type view would display one user per row some row styles use fields which means you select from the available fields to display others do not they are able to use the base type and create a display usually row styles that do not use fields produce less efficient slower views  so bear this in mind when contemplating the performance of your site ',0);
INSERT INTO `search_dataset` VALUES (80,'help',' list output style the list view style will display every row of the view as part of an html list construct for example row 1 row 2 row 3 row 4 you may select whether or not the list is ordered which just means whether or not it uses numbers instead of the bullet row 1 row 2 row 3 row 4 the list style also uses a row style which means that it doesn t care what the actual output for each row of the view is if you need information about using css to style list views you may find this a list apart guide to styling lists useful ',0);
INSERT INTO `search_dataset` VALUES (81,'help',' unformatted output style the unformatted output style simply places each row of the view one after another with no additional formatting  ',0);
INSERT INTO `search_dataset` VALUES (82,'help',' table output style the table style will display the view results as a table each row of the table will correspond to a row from the view result when setting the table options each field in the view will be presented with some information next to each field  column by default each field is its own column however you can place multiple fields in the same column to do this pick which field you want to represent the column then pick another field and set the column value to that field you can place as many fields as you like in a single column but only the main field in a column can be clicksorted separator if you have multiple fields in the same column the separator will be placed between each one at the very least nbsp should be used as without the separator the fields will be placed very close to each other common separators are a bullet the symbol and a comma if there are no other fields in the column the separator will have no effect sortable if checked the header for the column will be clickable and the user may resort the table by clicking on this to sort by that field at this time views does not support clicksorting to sort by multiple columns at the same time default sort you may select a column which will be sorted by default when the table is first viewed this column will be highlighted to the user you may also select whether the default sort is ascending or descending  ',0);
INSERT INTO `search_dataset` VALUES (83,'help',' grid output style the grid style will display each row of your view within a grid you may customize the number of columns though it defaults to 4 a grid looks like this row 1 row 2 row 3 row 4 row 5 row 6 row 7 row 8 row 9 row 10 row 11 row 12 row 13 row 14 row 15 row 16 the above uses the horizontal alignment where rows are added into the grid from left to right with a vertical alignment rows will be placed from top to bottom like this row 1 row 5 row 9 row 13 row 2 row 6 row 10 row 14 row 3 row 7 row 11 row 15 row 4 row 8 row 12 row 16 this style uses a row style to determine what each row will look like ',0);
INSERT INTO `search_dataset` VALUES (84,'help',' rss output style the rss output style is only available for feed display types it will display the view as an rss feed which is a specialized xml output this output is not user visible but can be parsed by feed readers for aggregation you may supply a description for the rss feed most feed readers will display this description along with the contents of the feed you may also select to use the site s mission statement for the description ',0);
INSERT INTO `search_dataset` VALUES (85,'help',' fields row style the fields row style displays each field defined in the view one after another each field defines its own output by default each field is put in a div unless it is selected to be inline  if it is inline it is put in a span two items in div s will be displayed one after another with the second one below the first two items in span s will be displayed on the same line one item in a span next to div s is the same as two items in div s this means that for the inline setting to do anything at least two consecutive items must be set inline you may define a separator which will be placed between each item this separator may be html you can use nbsp to print blank space ',0);
INSERT INTO `search_dataset` VALUES (86,'help',' node row style the node row style will display each item of the view through drupal s standard nodeview  function views has very little control over this output except for the options you see instead the output is run through the standard node template mechanism typically nodetplphp or a variant thereof and any decisions about what is output may be done there views does add an extra suggestion to the list of possible node templates  nodeviewviewnametplphp  you may use this to theme a node specifically for the view this can be handy for creating very small teasers and the like you may opt to display the full node body or the node teaser and you may add the node links such as he comment links that appear after a node or not because of this behavior  the node row style does not utilize fields and the fields section will not be displayed please note that this row style performs a nodeload for every row and as such can produce a lot of extra queries sometimes this is necessary but it can have a negative impact on your site s performance  ',0);
INSERT INTO `search_dataset` VALUES (87,'help',' node rss item row style this row style is only available to rss styles it produces xml necessary for an rss feed for the node record ',0);
INSERT INTO `search_dataset` VALUES (88,'help',' comment rss item row style this row style is only available to rss styles it produces xml necessary for an rss feed for the comment ',0);
INSERT INTO `search_dataset` VALUES (89,'help',' unformatted summary style the unformatted summary style is only available for summary styles which are when an argument has been set to provide a summary if it was not provided with a value this summary provides the possible candidates for the argument one after another with no special formatting if inline is selected the summary items will be enclosed within span tags otherwise the items will be in div tags you can also elect to display the number of matching records for the argument plus change the number of items per page for the summary this is often useful because summary views are often quite small but other views quite space intensive it is very common to have far more records available in the summary view than in the more normal view ',0);
INSERT INTO `search_dataset` VALUES (90,'help',' list summary style the list summary style is only available for summary styles which are when an argument has been set to provide a summary if it was not provided with a value this summary provides a list of possible candidates for the argument in a standard html list like the normal list style you may set this list to be ordered or not you can also elect to display the number of matching records for the argument plus change the number of items per page for the summary this is often useful because summary views are often quite small but other views quite space intensive it is very common to have far more records available in the summary view than in the more normal view ',0);
INSERT INTO `search_dataset` VALUES (91,'help',' menu options page display  page displays can hook into the drupal menu system and provide menu links that will appear in the navigation system as well as tabs that can be used to keep views next to each other for simple menu links  there is very little you need to do simply select normal menu entry and fill in the text for the title this will appear in the navigation menu by default you will need to visit the menu administration page to move this to another menu tabs are not quite so simple there are some complex rules for using tabs in drupal all tabs must have a parent which is the next level up in the path hierarchy for example if the view path is example taba then the parent must be example all tabs must have one and only one default tab this is usually the same content as the parent if a parent does not exist when creating the default tab views will allow you to also create a parent item it will automatically set up the url for you when it does this tab weight is used to control what order the tabs are displayed in lower numbers will display more to the left for tabs whose numbers are the same they will be displayed alphabetically drupal only supports 2 levels of tabs so be careful about trying to put tabs within tabs within tabs that won t work for example if you have two views that you want to be tabs you could set it up like this in the first view set the path to tabs tab1 set it to be the default tab set the title to tab 1 and the weight to 0 click update and you will be taken to a form that lets you define the parent since tabs doesn t already exist in the system select normal menu item and set the title to tabs on the second view set the path to tabs tab2 set it to be a menu tab and set the title to tab 2 with this done you will now have a navigation link named tabs and when you click on it you will go to the tabs with tab 1 being the default tab that appears you can then click between tab 1 and tab 2  ',0);
INSERT INTO `search_dataset` VALUES (92,'help',' path options page display  if a display has a path that means that it can be retrieved directly by calling a url as a first class page on your drupal site any items after the path will be passed into the view as arguments for example if the path is foo bar and a user visits http wwwexamplecom foo bar baz beta  baz and beta will be given as arguments to the view these can be handled by adding items to the arguments section you may also use placeholders in your path to represent arguments that come in the middle for example the path node someview would expect the first argument to be the second part of the path for example  node 21 someview would have an argument of 21  note  views 1 used  arg for this kind of thing arg is no longer allowed as part of the path you must use instead if multiple displays within the same view have the same path the user will get the first display they have access to this means you can create successfuly less restricted displays in order to give administrators and privileged users different content at the same path ',0);
INSERT INTO `search_dataset` VALUES (93,'help',' theme information you may use any of the following possible theme files to modify individual parts of your view in total there are four parts to theming a view the display theme is usually viewsviewtplphp and it largely controls the decorations around a view where the header footer pager more link feed icon etc will be placed the style will control how all of the results of the display are put together it may be as simple as just displaying all of the rows or it may be a complex table generator or something in between the row style controls each individual row not all styles utilize the row style notably the table but most others do finally  field themes allow you to override the look and even the data of each individual field if the style uses fields the actual template the system will use should be hilighted in bold  a breakdown of view output the link to the left of each type will give you information about the default template used for that type you may cut and paste this and place it in your theme with the appropriate template or you may copy the base file from the views theme directory or if provided by a module from the module s directory  it is important that you clear the theme registry cache every time you add a new template or the new template will not be picked up important note  you place your custom template files in your theme directory  not views theme  this is always true of theming with drupal in addition to this tool the very useful devel module contains a tool called the theme developer which does a good job of visually showing you which areas of your site use which themes be careful with it though as the theme developer causes the views edit page to break also this feature will only work properly with drupal 63 and later prior to drupal 63 this patch will be required  ',0);
INSERT INTO `search_dataset` VALUES (94,'help',' using views templates views theme templates are straightforward to use with the drupal theming system if you are unfamiliar with the theming system at all you should probably at least read drupalorg theming documentation  that said these are the important things you need to know copy a base views template to one of the names provided from the theme information section of the view copy this template right into your theme directory clear the theme registry see the instructions for how to do this your new template should now operate assuming you picked a nicely named template that includes the view name that template should now be active for your view a good example is viewsviewlistfoobartplphp which would work for a view named foobar you can now modify this template all you like for any template that uses fields the fields will be in array in order to use this effectively you will need to understand enough php to fetch data from an array this is a place where the devel module can really help you because you can use its dsm function right in your template to see what variables it uses there is an alternative to dsm that works without devel module but it s a bit longer to use for example i placed the following code inside a loop in viewsviewtablephpphp php drupalsetmessage pre varexport row true pre and it produced this output array nid 97 title scisco ideo vicis feugiat qui name luwrepuslan my view had three fields node nid node title user name the contents of the row variable included these fields in precisely the order that i had arranged them to using the views rearrange link also worth noting though is that each field also has an identifier so it can easily be pulled out of the row should i want to display it differently using php print row title would print just the title for that row please remember that i m doing this inside the loop so this will get repeated for every row of the view the ids used to fetch items from the array id  row title  can be quickly and easily looked up on the theme information page once a field has been added to the view its id will not change but note that if there are two title fields in a view one will be title and the other will be title1 in order to prevent namespace collisions the important thing here is that views does provide ids views doesn t tell you what these ids are but it s easy to get them by dumping the row data and doing a simple visual inspection views does guarantee that these ids will not change unless you actually add a new field and remove the existing one in which case title above would become title1  the basic fields template the most common template people will need to rewrite is the simple viewsviewfieldstplphp which is the template used by the fields row style and all it does is display a simple list of fields however it is not that simple to the user because the template can t inherently know what the fields are it has to go through an array in a loop this loop isn t very handy when you really want to have fine control over the template by placing your fields precisely where and how you want relax though if you know what your fields are you can rewrite this if you end up writing your own html the only part that is really important is the content for each field we know from above that you can get the id for each field on the theme information page from the view in the header for the template we can see that the fields are all in the fields array and each field is an object that leads us to this php print fields someid content assuming you replace someid with an id found on the theme information page this code will print the content for that field you can also get the label and some other data about the field as well as the raw information complete details for what is available are documented directly in viewsviewfieldstplphp keep in mind that if you rewrite your templates using this you ll need to maintain this template whenever changes are made to the fields of the view while this isn t generally recommend sometimes it s necessary to get the kind of control you might ultimately need  ',0);
INSERT INTO `search_dataset` VALUES (95,'help',' using css with views views uses a wide array of css classes on all of its content to ensure that you can easily and accurately select exactly the content you need in order to manipulate it with css typically every view is wrapped in a div with the name of the view as part of its class for all these examples we will assume the name of the view is myview  as well as the generic class view div class view viewmyview div in your css you can modify all views divview border 1px solid black or just your view divviewmyview background yellow by default the general view template also provides the following classes to easily style other areas of the view viewheader viewfilters viewcontent viewempty if an empty text is used when the view has no results viewfooter feedicon attachmentbefore if using an attachment display attachmentafter if using an attachment display so for example divviewmyview divviewheader make the header stand out fontsize 120 fontweight bold divviewmyview divviewfooter make the footer less important fontsize 80 fontstyle italic color ccc in the above example we whimsically made the header bold and in a bigger font and the footer smaller italicized and greyish views with fields if your view has fields each field is uniquely tagged with its id a field s id may be gleaned from the theme information page note that due to css rules any in the id will be converted to automatically so if you have a field whose id is editnode this is the field used to provide an edit link to a node it will be editnode additionally to make sure that the view ids don t conflict with other css classes in the system they will be pretended with viewsfield thus the final css class for the field with the id editnode will be viewsfieldeditnode  exactly how this appears is going to depend upon the style you re using for example the unformatted style uses divviewsfieldeditnode and divviewslabeleditnode to access that particular field but a table would use tdviewsfieldeditnode and thviewsfieldeditnode to access the table header or just viewsfieldeditnode to affect both viewmyview th color red make all headers red viewmyview viewsfieldtitle fontweight bold make the title field bold viewmyview tdviewsfieldbody fontsize 60 make the text in the body field small  ',0);
INSERT INTO `search_dataset` VALUES (96,'help',' what are overrides  if an item is using defaults then it is using values from the default display  important note  if you modify this value you are modifying the default display and thus modifying for all displays that are using default values if that is not what you intend you must click the override button once overridden that display now has its own version of the value modifying it will not modify it for other displays for relationships   arguments   fields   sort criteria  and filters  each of these must be overridden as a group in other words you cannot override a single filter but instead must override allr filters a message will appear on the item to let you know what its status is but you can only change the status by clicking on the header or the rearrange button for that item ',0);
INSERT INTO `search_dataset` VALUES (97,'help',' embedding a view into other parts of your site you can easily embed the results of a view into other parts of your site either with code as a module or in nodes or blocks as snippets the easiest way is to use the function viewsembedview   embed a view using a php snippet this function is meant to be called from php snippets should one wish to embed a view in a node or something it s meant to provide the simplest solution and doesn t really offer a lot of options but breaking the function apart is pretty easy and this provides a worthwhile guide to doing so param name the name of the view to embed param displayid the display id to embed if unsure use default as it will always be valid but things like page or block should work here param any additional parameters will be passed as arguments function viewsembedview name displayid default to figure out the id of a display hover your mouse over the tab to select that display everything after the viewstab is the id of that display this id is guaranteed never to change unless you delete the display and create a new one  ',0);
INSERT INTO `search_dataset` VALUES (98,'help',' what s new in views 2 views 2 is the newest major release of views and it is specifically coded for drupal 6 views 2 retains all of the core functionality of views 1 together with a completely revamped user interface and a large set of new features which greatly expand upon the original featureset of views 1 this document is a sidebyside comparison of views 1 versus views 2 from a user s perspective detailing the ui changes some new ways to perform old tasks the cool new features of views 2 and how these features can be used to address some of the shortcomings of views 1 admin interface the first thing that pops out after you install views 2 is the radically different admin interface  views 2 admin interface compared to the old comfy views 1 interface  views 1 admin interface the new admin interface performs the same functions as the old listing all the views in the system providing links to add or import views and a link to views tools but has been compacted with each view displayed as a paragraph stylerow compared to the table of views 1 and set of filters on top to ease locating views among a large list contexthelp is available by clicking the small blue questionmark icon contexthelp in views 2 is provided by the advanced help module so make sure to install that together with installing views 2 the small blue help icons will be available in various parts of the views ui in particular look for them as part of the description of a display  when setting style options and in various editing sections such as path   menu and the like several new attributes of each view are visible in the filter header  tag  this is just another label for organizing and sorting views tags can be any text views that are provided by modules will often be tagged together to make it easy to find them display  in views 1 each view query was tied to its display in other words your fields sorts filters and arguments could only be displayed in the single page or block display provided in the view definition in views 2 view displays have been decoupled from view queries it is now possible to have multiple page block and feed displays from a single view more on view displays later type  views 2 view types are radically different from views 1 types views 1 types basically defined how the node list displays were styled  you had full nodes teaser list table view and so on in views 2 view display styles have been broken out into the separate style attribute view types now refer to the primary table on which information for the query will be retrieved which controls what arguments fields sort criteria and filters are available views 2 view types are discussed later adding a view so let s jump in and add a view for this example we re going to create a user view which will display a list of users adding a view the first step in adding a view is simply entering a name only alphanumeric characters no spaces a description tag and the view type to get the user view we selected the user radio button configuring the new view this might be the 2nd whoa moment as the interface here is also completely revamped from views 1x the best way to summarize is to say all the pieces from the views 1x interface are still therejust in different places fields arguments sort critera and filters are all still there there just in new ajaxyflavours let s start by adding some fields  adding fields clicking on the icon next to the word fields unfurls a section beneath the view information with all the available fields grouped by comment file node node revision taxonomy and user and probably a few others this is a general paradigm for the views 2 interface clicking on a widget or link unfurls a section beneath the view information with the relevant interface usually what is being edited will be hilited in yellow as well when adding items you can use the groups dropdown box to show only a subset of the fields available according to the above groups or select all to see all fields available which is what was selected when the section unfurled for our example we re selecting the user group and adding the user email   user name and user picture fields adding fields once we add our fields they show up in the fields section of the interface we will be walked through each field we added so keep clicking update  even if you don t make changes to the field and you will see the next one the fields we added can be rearranged by clicking the up down icon right next to the add icon we used earlier we can also remove a field using the same interface rearranging fields from here the fields can be dragged up and down by grabbing the little drag handle on the left and moving them where you like making a change to any part of the view by clicking update usually triggers a refresh of the view preview which is conveniently located right below the main interface views preview now that we have some fields set up we can turn our attention to basic settings for the view it s important to note that all the interface elements pertain to the current display selected for the view as mentioned before a view can have multiple displays the first time you create a view you ll be manipulating the default display you can add displays using the add display button whose basic settings are completely different from each other this lets you have as many displays of a view as you would like all sharing items such as sort criteria filters and arguments but different display settings like title style fields and pager settings also any display you add automatically inherits display settings from the default display initially so you can keep a core of common settings in your default display and add additional settings for every other display adding a page display let s stick with the default display and twiddle some settings we can set the title to user view 1 and the style to table as mentioned earlier view styles in views 2 correspond more to view types in views 1 remember list table teasers full nodes  selecting a views 1 view type in views 2 view styles control how a view display looks these styles are significantly different from the types in views 1 in particular types have been broken up there is now the style as well as the row style which focus on different parts of the output a breakdown of view output we change the style by clicking on the current style on the left hand side of the view information area selecting a views 2 display style we re given the style options of grid   list   table and unformatted  additional display styles can be added by modules which have views style plugins  choosing a style reveals a settings button which you can click to configure the style you ve chosen in the shot below we ve selected and are configuring the table style which we re using to produce a more compact output than we had earlier selecting and configuring the table style  todo finish this document  ',0);
